export function minKBitFlips(nums: number[], k: number): number {
  let zeroIndexes: number[] = [];
  let oneIndexes: number[] = [];

  for (let i = 0; i < k; i++) {
    if (nums[i] === 0) {
      zeroIndexes.push(i);
    } else {
      oneIndexes.push(i);
    }
  }

  let start = 0;
  let totalFlips = 0;
  const MAX_START = nums.length - k;

  while (start <= MAX_START) {
    if (start === oneIndexes[0]) {
      start += 1;
      oneIndexes.shift();
      if (start <= MAX_START) {
        const lastNewIndex = start + k - 1;
        if (nums[lastNewIndex] === 0) {
          zeroIndexes.push(lastNewIndex);
        } else {
          oneIndexes.push(lastNewIndex);
        }
      }

      continue;
    }
    // nums[start] is zero, so flip all bits in window
    const tmp = zeroIndexes;
    zeroIndexes = oneIndexes;
    oneIndexes = tmp;
    totalFlips += 1;
  }

  return zeroIndexes.length === 0 ? totalFlips : -1;
}

console.log(minKBitFlips([0, 1, 0], 1)); // 2
console.log(minKBitFlips([1, 1, 0], 2)); // -1
console.log(minKBitFlips([0, 0, 0, 1, 0, 1, 1, 0], 3)); // 3

